import React from "react";
export default function ShowWeather({weatherData}) {
    return ( <>
    <header><h1>Weather Data</h1></header>
    <section>
    {weatherData.main ? <div id="weather-data">Temperature is: {weatherData.main.temp} Farenheit</div> : <div id="loading-weather-data">Loading</div>}
    </section>

    <footer><p>Footer</p></footer>
    </>
    )

}
